import React from 'react';


const ProfileInfoPage = async () => {
  if (sessionStorage.getItem('state') === null) {
    window.location.replace('/login/');
  } else {
    const email = JSON.parse(sessionStorage.getItem('state')).account;
    const result = await fetch(`/api/seekers/${email}`);
    const profileInfo = await result.json();
    console.log(profileInfo);
    var array = [];
    var i;
    for(i in profileInfo) {
      array.push([i, profileInfo[i]]);
    }
    return(
      <>
        <h1> My account </h1>
        <div>
        <ul>
          {array.map((pair, key) => (
            <li>{pair[0]}: {pair[1]}</li>
          ))}
        </ul>
        </div>
      </>
    );
  }
};

export default ProfileInfoPage;
